script: |
  super -f text -I q3296.spq | sort > q3296.out

inputs:
  - name: q3296.spq
    data: |
      SELECT b,
      abs(b-c),
      d
      FROM t1 (FORMAT parquet)
      WHERE d NOT BETWEEN 110 AND 150
      AND (e>a AND e<b);
  - name: t1

outputs:
  - name: q3296.out
    data: |
      194	1	190
      223	1	222
      249	2	248
